	public static byte[][] paintToArray(byte[][] pallete,byte[][] canvas) {
		byte[][] output=new byte[canvas.length][canvas[0].length*3];
		for(int i=0;i<canvas.length;i++) {
			for(int j=0;j<canvas[0].length;j++) {
				for(int k=0;k<3;k++) {
					output[i][j*3+k]=pallete[canvas[i][j]][k];
				}
			}
		}
		return output;
	}
